import React from "react";

function Nav({ setTheme, getActiveTheme }) {
  // let theme = getActiveTheme();
  // console.log("props", props);
  return (
    <div className="navbar" onload={e => getActiveTheme()}>
      <div className="nav-item">Portfolio</div>
      <div className="nav-item">Portfolio</div>
      <div className="nav-item">DataViz</div>
      <button className="solid-btn accent" onClick={e => setTheme()}>
        Theme
      </button>
    </div>
  );
}

